import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useRouteMatch
} from "react-router-dom";
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import InboxIcon from '@material-ui/icons/MoveToInbox';
import MailIcon from '@material-ui/icons/Mail';
// This example show how you could create a custom
// <Link> that renders something special when the URL
// is the same as the one the <Link> points to.

export default function CustomLinkExample() {
  return (
    <Router>
      <div>
        <OldSchoolMenuLink
          activeOnlyWhenExact={true}
          to="/"
          label="Home"
          icon="1"
        />
        <OldSchoolMenuLink to="/about" icon="2" label="about" />

        <hr />

        <Switch>
          <Route exact path="/">
            <Home />
          </Route>
          <Route path="/about">
            <About />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

function OldSchoolMenuLink({ label,icon, to, activeOnlyWhenExact }) {
  var iii=null;
  let match = useRouteMatch({
    path: to,
    exact: activeOnlyWhenExact
  });
  if(icon===1){
    iii=<InboxIcon/>
  }else{
    iii=<MailIcon/>
  }
  return (
    <div className={match ? "active" : ""}>
      {match && "> "}
  <Link to={to}>
    {iii}
    {label}
  </Link>
    </div>
  );
}

function Home() {
  return (
    <div>
      <h2>Home</h2>
    </div>
  );
}

function About() {
  return (
    <div>
      <h2>About</h2>
    </div>
  );
}
function iconandtext(props) {
  return (
    <div>
      <InboxIcon />
      <h6>"props"</h6>
    </div>
  );
}
